<template>
  <q-img
    class="q-pa-none"
    :src="image"
    :ratio="16 / 9"
    :placeholder-src="placeholder"
  >
    <div v-if="caption" class="absolute-full text-subtitle2 flex flex-center">
      VIEW MORE
    </div>
  </q-img>
</template>

<script>
export default {
  name: "CommodityImage",
  props: {
    commodityGroup: String,
    caption: {
      type: Boolean,
      default: false
    }
  },
  computed: {
    placeholder() {
      return "data:image/png;base64,";
    },
    image() {
      const { commodityGroup } = this;
      let commodity = commodityGroup ? commodityGroup : "";
      let imageUrl = "";
      switch (commodity.toLowerCase()) {
        case "rice":
          imageUrl =
            "data:image/jpeg;base64,";
          break;
        case "corn":
          imageUrl =
            "data:image/jpeg;base64,";
          break;
        case "high value crops":
          imageUrl =
            "data:image/jpeg;base64,";
          break;
        case "livestock":
          imageUrl =
            "data:image/jpeg;base64,";
          break;
        case "fisheries":
          imageUrl =
            "data:image/jpeg;base64,";
          break;
        default:
          imageUrl =
            "data:image/png;base64,";
          break;
      }
      return imageUrl;
    }
  }
};
</script>
